import React, { useState } from 'react';
import './index.css';

const App = () => {
    const [Time, setTime] = useState(0);

    const onclk = () => {
        setTime(1);
    }

    return (
        <>
            <div>{Time}</div>
            <button onclick = {onclk}>Update</button>
        </>
    );
}

export default App;
